import React, {useState, useEffect} from 'react';
import QRCode from 'qrcode.react';
import '../static/ticket.css';
import logo from '../logo.png';
import Footer from './Footer';

export default function Ticket () {
  const [ticket, setTicket] = useState({});
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const getData = (ticket_id) => {
    fetch(`http://127.0.0.1:5000/api/tickets/${ticket_id}`, {
      method: 'GET',
      headers: {
        Authorization: `Bearer ${localStorage.getItem('access_token')}`
      }
    }).then(response  => response.json()).then(data => {
	    setTicket(data)
	    setDate(new Date(data.created_at.slice(0, -3) + "Z").toISOString().split('T')[0]);
	    setTime(new Date(data.created_at.slice(0, -3) + "Z").toISOString().split('T')[1].split('.')[0]);
    });
  }
  useEffect(() => {
      const id = localStorage.getItem('ticket')
      getData(id);
  }, [])
  return (
    <>
    <header>
	<nav>
          <ul>
            <li><Link to='/dashboard'><i className="fas fa-chevron-left back-icon" /></Link></li>
          </ul>
        </nav>
        </header>
    <div className='ticket'>
      <div className='ticket-header'>
        <img src={logo} />
        <p style={{textTransform:'uppercase'}}><strong>date generated: </strong>{date}</p>
      </div>
      <div className='ticket-info'>
        <div className='details'>
          <div className='distributions'>
            <span>Ticket ID:</span>
            <p>{ticket.id}</p>
          </div>
          <div className='distributions'>
            <span>Movie:</span>
            <p>{ticket.movie}</p>
          </div>
          <div className='distributions'>
            <span>Cinema:</span>
            <p>{ticket.cinema}</p>
          </div>
	  <div className='distributions'>
            <span>Streaming:</span>
	  <p>{date}</p>
          </div>
          <div className='distributions'>
            <span>Time:</span>
	  <p>{time}</p>
          </div>
          <div className='distributions'>
            <span>Price:</span>
            <p>{ticket.price}</p>
          </div>
          <div className='distributions'>
            <span>Seat Number:</span>
            <p>{ticket.seat_number}</p>
          </div>
        </div>
        <div className='qrcode'>
          <QRCode value={JSON.stringify(ticket)} size={128} />
        </div>
      </div>
    </div>
    <Footer/>
    </>
  );
}
